        public void ToString(
            INpcDataGetter item,
            FileGeneration fg,
            string? name = null,
            NpcData.Mask<bool>? printMask = null)
        {
            if (name == null)
            {
                fg.AppendLine($"NpcData =>");
            }
            else
            {
                fg.AppendLine($"{name} (NpcData) =>");
            }
            fg.AppendLine("[");
            using (new DepthWrapper(fg))
            {
                ToStringFields(
                    item: item,
                    fg: fg,
                    printMask: printMask);
            }
            fg.AppendLine("]");
        }
        
